script: |
  super -f text -I q761.spq | sort > q761.out

inputs:
  - name: q761.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE - col2 + + 90 > ( + - 79 * col0 * ( col1 ) * 5 / col2 * - CAST ( + + col0 AS INTEGER ) + col0 );
  - name: tab0

outputs:
  - name: q761.out
    data: |
